import './App.css';
import LoginForm from './components/LoginForm';
import ChuckNorris from './components/ChuckNorris';

function App() {
    const [token, setToken] = useState(null);

    return (
        <div className="App">
            <header className="App-header">
                <LoginForm setToken={setToken} />
                <ChuckNorris />
            </header>
        </div>
    );
}

export default App;
